    json_str = [[{"args":{"uuid":"1","args":[{"name":"conn_check","value":4}]}}]]
end
local json_tb = cjson.decode(json_str)
connect_host = {} 
local ONLINE = 1
local OFFLINE = 2
local MANAGER = 3
