local ONLINE_ADD = 6
info_str = ""

function test_conn(host, port) 
    local tcpSocket = socket.tcp()
    tcpSocket:settimeout(0.01,'b')
    tcpSocket:settimeout(0.01,'t')
    local c,status = tcpSocket:connect(host,port)
    info_str = info_str.."\n try "..host.." "..tostring(port).." "..tostring(c).." "..tostring(status)
    if c ~= nil then
        --[[
        local peer_host, peer_port, name = tcpSocket:getpeername()
        info_str = info_str.."\n peerinfo: "..peer_host.." "..peer_port.." "..name
        local sock_host, sock_port, name = tcpSocket:getsockname()
        info_str = info_str.."\n sockinfo: "..sock_host.." "..sock_port.." "..name
        local recv_b, send_b, age = tcpSocket:getstats()
        info_str = string.format("%s\n status: %s %s %s",info_str,recv_b, send_b, age)
        --local send_b, tmp_msg = tcpSocket:send("GET / HTTP/1.0\r\n\r\n")
        --]]
        local recv_p, status, partial = tcpSocket:receive("*a")
        info_str = string.format("%s\n receive: %s %s %s",info_str,tostring(recv_p),tostring(status),tostring(partial))
        if partial and rex.match(partial, [[ssh]], 1, "i") then
            table.insert(connect_host, {host=host, port=port})
        end
        coroutine.yield(c)
    end
    tcpSocket:close()
end

threads = {} 
  
function get_conn(host, port)  
    local co = coroutine.create(function ()  
        test_conn(host, port)  
    end)  
    table.insert(threads, co)  
end  

function dispatch()  
    local i = 1  
    while true do  
        if threads[i] == nil then 
            if threads[1] == nil then 
                break  
            end  
            i = 1  
        end  
        local status, res = coroutine.resume(threads[i]) 
        if not res then   
            table.remove(threads, i)  
        else  
            i = i + 1  
        end  
    end  
end  

