function classify_ip(ipaddr)
    local a,b = rex.match(ipaddr, [[(\d*)\.(\d*)]])
    a = tonumber(a)
    b = tonumber(b)
    if a == 100 then
        if b == 64 or b == 65 or (b > 75 and b < 80) then
            return MANAGER
        elseif b == 66 or b == 67 then
            return OFFICE
        elseif b > 67 and b < 76 then
            return OFFLINE
        else
            return ONLINE
        end
    elseif a == 192 then
        return UNKNOWN
    elseif a == 10 then
        if b == 10 or b == 127 then
            return ONLINE
        else
            return ONLINE
        end
    else
        return UNKNOWN
    end
end

function allocate_ip(_type)
    local ip_list = {}
    local ip_type
    if _type == ONLINE or _type == ONLINE_ADD then
        for _,ip in pairs(all_ip) do
            ip_type = classify_ip(ip)
            if ip_type == OFFLINE or ip_type == OFFICE then
                table.insert(ip_list, ip)
            end
        end
    elseif _type == MANAGER then
        for _,ip in pairs(all_ip) do
            ip_type = classify_ip(ip)
            if ip_type == OFFICE then
                table.insert(ip_list, ip)
            end
        end
    elseif _type == OFFLINE then
        for _,ip in pairs(all_ip) do
            ip_type = classify_ip(ip)
            if ip_type == OFFICE or ip_type == MANAGER or ip_type == ONLINE then
                table.insert(ip_list, ip)
            end
        end
    elseif _type == OFFICE then
        for _,ip in pairs(all_ip) do
            ip_type = classify_ip(ip)
            if ip_type == ONLINE or ip_type == MANAGER then
                table.insert(ip_list, ip)
            end
        end
    end
    return ip_list
end

